Switch the phone on and off Press and hold the end key until the phone switches on or off. If the phone asks for a PIN, enter the code, and select OK.", "model_output": " Apague y encierre el teléfono (cambiarlo entre estado encendido y apagado). Pulse y mantenga presionada la tecla de fin hasta que el teléfono se vuelva a encender o se apague. Si el teléfono pide un PIN, introduzca el código y seleccione OK.

Traducción en castellano: Apaga y encierra el teléfono (cambiarlo entre estado encendido y apagado). Pulsa y mantenga presionada la tecla de fin hasta que el teléfono se vuelva a encender o se apague. Si el teléfono pide un PIN, introduzca el código y seleccione OK."}}

